__NUXT_JSONP__("/svet/mesto/dauha", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s,t,u,v,w,x,y){return {data:[{place:[{id:j,id_state:l,name:m,population:848050,area:132,altitude:7,slug:n,information_chatgpt:"\u003Cp\u003EDauhá je hlavním městem Kataru, které se nachází na východním pobřeží poloostrova. Je to moderní a dynamické město s bohatou historií a kulturou, která se snoubí s moderními architektonickými skvosty.\u003C\u002Fp\u003E\n\u003Cp\u003EJednou z nejvýraznějších památek v Dauhá je mešita Al-Masjid al-Nabawi. Tato impozantní mešita je významným centrem náboženského života v městě a nabízí návštěvníkům pohled na jeho architektonickou krásu. Další ikonickou stavbou je Museum of Islamic Art, které představuje bohatství a rozmanitost islámského umění a kultury.\u003C\u002Fp\u003E\n\u003Cp\u003EDauhá je také známá svými moderními mrakodrapy, z nichž nejznámějším je věž Aspire Tower. Tato výšková budova se nachází v centru města a nabízí úchvatný výhled na okolní panorama. Další zajímavým místem je The Pearl-Qatar, umělý ostrov, který je vybudován na břehu Dauhá. Tento luxusní komplex nabízí návštěvníkům exkluzivní obchody, restaurace a rezidence.\u003C\u002Fp\u003E\n\u003Cp\u003EPro milovníky přírody a relaxace je Corniche, promenáda lemovaná palmami, ideálním místem pro procházky a pikniky. Na Corniche se nachází také několik pláží, kde si můžete užít slunce a moře. Dauhá je také domovem několika parků, jako je například MIA Park, který nabízí zelené prostředí a příležitosti pro sportovní aktivity.\u003C\u002Fp\u003E\n\u003Cp\u003EV Dauhá se také konají různé festivaly a kulturní události, které přinášejí do města živost a radost. Mezi nejznámější patří Dauhá Tribeca Film Festival, který představuje nejnovější filmy z celého světa, a Dauhá Jewelry and Watches Exhibition, kde si můžete prohlédnout a zakoupit šperky a hodinky od předních světových návrhářů.\u003C\u002Fp\u003E\n\u003Cp\u003EPro milovníky nakupování nabízí Dauhá řadu moderních nákupních center, jako je Villaggio Mall nebo Mall of Qatar, kde si můžete vychutnat nakupování, jídlo a zábavu na jednom místě.\u003C\u002Fp\u003E\n\u003Cp\u003EDauhá je fascinujícím městem, které kombinuje bohatou kulturu, moderní architekturu a přírodní krásy. Je to ideální destinace pro ty, kteří chtějí objevovat nové zážitky a poznávat jedinečnou atmosféru Kataru.\u003C\u002Fp\u003E",coordinates:[{latitude:25.2854,longitude:51.531}],biggest:"yes",type_place:c,id_image_cover:a,id_image_hero:a,affiliate:[{name:o,value:p}],alerts:a,zoom:[{google:q,booking:11}],parking:a,information_author:a,importance:d,seo_tags:a,created_at:"2023-12-27T16:36:26.534285+00:00",updated_at:"2023-12-27T17:06:48.496338+00:00"}],imagePlace:[],placeState:[{tld:".qa",name:"Katar",area:11571,population:2930524,slug:r,id_continent:f,information_chatgpt:"\u003Cp\u003EKatar je malý arabský stát, který se nachází na východním pobřeží Arabského poloostrova v Perském zálivu. Má bohatou historii, kulturu a tradice, které jsou spojeny s mořem a pouští. \u003C\u002Fp\u003E\n\u003Cp\u003EHlavním městem Kataru je Dauhá, která je kulturním a hospodářským centrem země. Město je známé svými luxusními hotely, nákupními centry a moderními budovami, jako je například slavná Dauhá Tower. \u003C\u002Fp\u003E\n\u003Cp\u003EKatar má mnoho přírodních krás, včetně národního parku Al Reem, který se nachází na severu země. Park nabízí krásné výhledy na poušť a je domovem mnoha endemických druhů rostlin a živočichů. \u003C\u002Fp\u003E\n\u003Cp\u003EDalší zajímavou atrakcí v Kataru je Muzeum islámského umění, které se nachází v Dauhá. Muzeum ukazuje bohatství a rozmanitost islámské kultury a umění. \u003C\u002Fp\u003E\n\u003Cp\u003EKatar je také známý pro své sportovní akce, jako jsou například závody Formule 1, které se konají na okruhu Yas Marina v Abu Dhabi, a také Mistrovství světa ve fotbale v roce 2022, které se bude konat v Kataru. \u003C\u002Fp\u003E\n\u003Cp\u003EKatar má horké a suché klima s teplotami, které se v létě mohou dostat až k 50 °C. Nejlepší období pro návštěvu je v zimě, kdy jsou teploty příjemnější. \u003C\u002Fp\u003E\n\u003Cp\u003EKatar je země s bohatou historií, kulturou a přírodou. Nabízí mnoho možností pro turisty, kteří hledají luxusní hotely, moderní architekturu, krásné přírodní scenérie a kulturní zážitky. \u003C\u002Fp\u003E",currency_code:"QAR",currency_name:"Katarský rial",money_prices:[{name:"Taxi (cena za km)",value:2.2,date_update:e},{name:"Hlavní jídlo",value:s,date_update:e},{name:"Chleba",value:t,date_update:e},{name:"Mléko",value:f,date_update:e},{name:"Voda (500ml)",value:1.5,date_update:e},{name:"Espresso",value:q,date_update:e},{name:"Zmrzlina (jeden kopeček)",value:5,date_update:e},{name:"Pivo",value:s,date_update:e},{name:"Krabička cigaret",value:u,date_update:e},{name:"Big Mac",value:u,date_update:e},{name:"Coca Cola (500ml)",value:f,date_update:e}],phone_numbers_emergency:[{name:"Mezinárodní tísňová linka",value:"112",date_update:b},{name:"Policie",value:h,date_update:b},{name:"Hasiči",value:h,date_update:b},{name:"Zdravotnická záchranná služba",value:h,date_update:b},{name:"Turistická policie",value:"4488 1212",date_update:b},{name:"Horská záchranná služba",value:"4454 6780",date_update:b},{name:"Pobřežní záchranná služba",value:h,date_update:b}],phone_prefix:"+974",coordinates:[{latitude:"25.3548",longitude:"51.1839"}],people_religion:[{name:"Islám",value:"67,7%",date_update:i},{name:"Křesťanství",value:v,date_update:i},{name:"Hinduismus",value:v,date_update:i},{name:"Jiné",value:"4,7%",date_update:i}],people_nationality:[{name:"Katarci",value:"60%",date_update:g},{name:"Indové",value:"24%",date_update:g},{name:"Nepálci",value:"6%",date_update:g},{name:"Filipínci",value:w,date_update:g},{name:"Bangladéšané",value:w,date_update:g}],visitors_entry:[{name:"Občanský průkaz",value:"Pro vstup do Kataru potřebujete cestovní pas, občanský průkaz nestačí.",date_update:b},{name:"Cestovní pas",value:"Pro vstup do Kataru potřebujete platný cestovní pas.",date_update:b},{name:"Vízum",value:"Občané Evropské unie a některých dalších zemí mohou vstoupit do Kataru bez víza na dobu 90 dnů během 180 denního období. Pokud potřebujete vízum, informace naleznete na stránkách katarského velvyslanectví v zemi vašeho pobytu.",date_update:b},{name:"Očkování",value:"Pro vstup do Kataru nejsou povinné žádné očkování. Nicméně se doporučuje očkování proti hepatitidě A a B, žloutence, obrně, tetanu a dávkám MMR (spalničky, zarděnky, příušnice) při absenci prokázaných protilátek.",date_update:b},{name:"Cestovní pojištění",value:"Pro vstup do Kataru není povinné mít cestovní nebo zdravotní pojištění, nicméně se doporučuje mít kvalitní zdravotní pojištění, které kryje veškeré případné náklady na léčbu a repatriaci v případě potřeby.",date_update:b},{name:"Bezpečnostní situace",value:"Katar je relativně bezpečná země s nízkou mírou kriminality a teroristických hrozeb. Nicméně je vždy důležité být obezřetný a dodržovat základní bezpečnostní opatření, jako je například uchovávání cenností v trezoru v hotelovém pokoji.",date_update:b},{name:"Další informace",value:"V Kataru je vysoká úroveň zdravotní péče a moderní infrastruktura. V zemi se běžně používá arabský jazyk, ale v turistických oblastech jsou běžné angličtina a další evropské jazyky. V letních měsících může být velmi horko, proto se doporučuje vhodné oblečení a dostatečné zásoby vody. Dále platí zákaz konzumace alkoholu na veřejnosti a omezení jeho prodeje na určené místa.",date_update:b}],type_place:x,id_image_cover:k,id_image_hero:k,id_city_main:j,affiliate:[{name:o,value:p}],mpz:"QA",alerts:a,zoom:[{google:y,booking:y}],ids_neighboring_countries:[{id:193}],organization:a,apps:a,links:a,information_author:a,seo_tags:a,language_phrases:a,wall_sockets:a,id:l,facts_place:a,created_at:"2023-12-27T16:33:10.517062+00:00",updated_at:"2023-12-27T17:07:31.480426+00:00"}],imageState:[{id:k,name:r,source:"\u002Fworld\u002Fstates\u002F",type:x,author:"pixabay.com",created_at:"2023-05-03T20:14:00.749527+00:00",updated_at:"2023-12-27T20:42:18.520959+00:00"}],placeContinent:[{id:f,slug:"asie",name:"Asie",area:44580000,population:4630000000,population_density:104.03,number_states:50,information_chatgpt:"\u003Cp\u003E\u003Cb\u003EAsie\u003C\u002Fb\u003E se rozkládá na ploše téměř 44,6 milionu kilometrů čtverečních a žije zde více než 4,5 miliardy lidí, což představuje téměř 60 % celkového počtu obyvatel planety. Kontinent zahrnuje celkem 48 zemí, mezi největší patří \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Frusko\"\u003ERusko\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fcina\"\u003EČína\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Findie\"\u003EIndie\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fjaponsko\"\u003EJaponsko\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Findonesie\"\u003EIndonésie\u003C\u002Fa\u003E\u003C\u002Fb\u003E.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EAsie\u003C\u002Fb\u003E je domovem mnoha významných světových kultur, jako jsou hinduismus, buddhismus, islám a taoismus. V každé zemi se můžeš setkat s odlišnými tradicemi, zvyky a jazyky. Mezi nejnavštěvovanější turistické destinace patří například \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fjaponsko\"\u003EJaponsko\u003C\u002Fa\u003E\u003C\u002Fb\u003E s jeho futuristickými městy, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fthajsko\"\u003EThajsko\u003C\u002Fa\u003E\u003C\u002Fb\u003E s bohatou kulturou a krásnými plážemi, nebo \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Findonesie\"\u003EIndonésie\u003C\u002Fa\u003E\u003C\u002Fb\u003E s neuvěřitelnou přírodou a množstvím ostrovů.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EAsie\u003C\u002Fb\u003E také nabízí mnoho kulturních a historických památek, jako je \u003Cb\u003EVelká čínská zeď\u003C\u002Fb\u003E, \u003Cb\u003ETaj Mahal\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Findie\"\u003EIndii\u003C\u002Fa\u003E\u003C\u002Fb\u003E, buddhistické chrámy v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fthajsko\"\u003EThajsku\u003C\u002Fa\u003E\u003C\u002Fb\u003E a mnoho dalšího. Zajímavou zkušeností může být i návštěva tradičních trhů, kde se dají ochutnat místní speciality a nakoupit různé exotické produkty.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EAsie\u003C\u002Fb\u003E má však také své výzvy a problémy, jako jsou například růst městských oblastí, nedostatek vody a znečištění ovzduší. Mnoho zemí se snaží najít řešení těchto problémů a přizpůsobit se moderním trendům, aby mohly udržet krok s ostatními zeměmi světa.\u003C\u002Fp\u003E\n\u003Cp\u003EPokud tě láká cestování po \u003Cb\u003EAsii\u003C\u002Fb\u003E, měl by sis předem zajistit víza a informovat se o místních zvycích a tradicích. Rozhodně se ti však naskytne možnost prozkoumat jedinečnou kulturu, přírodu a historii tohoto fascinujícího kontinentu.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cb\u003EAsie\u003C\u002Fb\u003E má také neuvěřitelně bohatou gastronomii, která se v jednotlivých zemích a regionech liší. Mezi nejznámější asijské pokrmy patří \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fjidlo\u002Fsushi\"\u003Esushi\u003C\u002Fa\u003E\u003C\u002Fb\u003E, různé druhy nudlí, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fjidlo\u002Fcurry\"\u003Ecurry\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003Edim sum\u003C\u002Fb\u003E, \u003Cb\u003Epho\u003C\u002Fb\u003E a další. Kromě toho se v \u003Cb\u003EAsii\u003C\u002Fb\u003E pěstuje mnoho exotických plodin, jako jsou \u003Cb\u003Eduriany\u003C\u002Fb\u003E, \u003Cb\u003Emangostany\u003C\u002Fb\u003E, \u003Cb\u003Erambutany\u003C\u002Fb\u003E a další ovoce, které můžeš ochutnat pouze zde.\n\u003C\u002Fp\u003E\u003Cp\u003E\n\u003Cb\u003EAsie\u003C\u002Fb\u003E je také známá svými svátky a tradicemi, jako je například \u003Cb\u003Ečínský Nový rok\u003C\u002Fb\u003E, \u003Cb\u003EDiwali\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Findie\"\u003EIndii\u003C\u002Fa\u003E\u003C\u002Fb\u003E, nebo \u003Cb\u003ESongkran\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fthajsko\"\u003EThajsku\u003C\u002Fa\u003E\u003C\u002Fb\u003E,. Tyto svátky jsou většinou spojeny s různými rituály a zvyky, které se v průběhu staletí vyvinuly a jsou dodnes respektovány.\n\u003C\u002Fp\u003E\u003Cp\u003E\nKromě toho má \u003Cb\u003EAsie\u003C\u002Fb\u003E mnoho přírodních krás, jako jsou \u003Cb\u003EHimálaje\u003C\u002Fb\u003E, pouště \u003Cb\u003EGobi\u003C\u002Fb\u003E a \u003Cb\u003EThar\u003C\u002Fb\u003E, nebo tropické pralesy v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Findonesie\"\u003EIndonésii\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmalajsie\"\u003EMalajsii\u003C\u002Fa\u003E\u003C\u002Fb\u003E. V \u003Cb\u003EAsii\u003C\u002Fb\u003E se také nachází mnoho národních parků a chráněných oblastí, kde žijí ohrožené druhy zvířat, jako jsou \u003Cb\u003Etygři\u003C\u002Fb\u003E, \u003Cb\u003Epandy\u003C\u002Fb\u003E, \u003Cb\u003Esloni\u003C\u002Fb\u003E a další.\n\u003C\u002Fp\u003E\u003Cp\u003E\nZkrátka, \u003Cb\u003EAsie\u003C\u002Fb\u003E je kontinent plný kontrastů a neuvěřitelných zážitků, které stojí za to objevovat. Budeš-li mít příležitost navštívit některou z asijských zemí, neváhej a vydaj se na dobrodružnou cestu plnou nových objevů a nezapomenutelných zážitků.\u003C\u002Fp\u003E",coordinates:[{latitude:47.751076,longitude:92.475286}],type_place:"continent",id_image_cover:f,id_image_hero:f,zoom:[{google:t,booking:f}],information_author:a,seo_tags:a,created_at:"2023-12-27T16:35:37.460505+00:00",updated_at:"2023-12-27T17:07:06.531847+00:00"}],placesCities:[{id:1837,id_image_cover:a,importance:d,slug:"al-daayen",type_place:c,name:"Al Daayen"},{id:1835,id_image_cover:a,importance:d,slug:"al-khawr",type_place:c,name:"Al Khawr"},{id:1839,id_image_cover:a,importance:d,slug:"al-khor",type_place:c,name:"Al Khor"},{id:1840,id_image_cover:a,importance:d,slug:"al-rayyan",type_place:c,name:"Al Rayyan"},{id:1834,id_image_cover:a,importance:d,slug:"al-wakrah",type_place:c,name:"Al Wakrah"},{id:1832,id_image_cover:a,importance:d,slug:"ar-rayyan",type_place:c,name:"Ar Rayyan"},{id:j,id_image_cover:a,importance:d,slug:n,type_place:c,name:m},{id:1836,id_image_cover:a,importance:d,slug:"madinat-ash-shamal",type_place:c,name:"Madīnat ash Shamāl\n"},{id:1838,id_image_cover:a,importance:d,slug:"mesaieed",type_place:c,name:"Mesaieed"},{id:1833,id_image_cover:a,importance:d,slug:"umm-salal-muhammad",type_place:c,name:"Umm Salal Muhammad"}],imagesCities:a}],fetch:{"OrganismsoPlaceTeaserSpotsComponent:0":{spots:[],images:a},"OrganismsoSidebarListComponent:0":{events:[],images:a}},mutations:[]}}(null,"05-2023","city","biggest","05-2021",3,"01-2017","999","01-2021",1831,286,187,"Dauhá","dauha","booking",true,10,"katar",35,2,18,"13,8%","4%","state",8)));